import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Navbar from "./Components/Navbar/Navbar";
import Hero from "./Components/HeroImg/HeroImg";

ReactDOM.render(
  <React.StrictMode>
    <Navbar />
    <Hero />
  </React.StrictMode>,
  document.getElementById("root")
);
